import React from 'react'
import { useState,useEffect } from 'react';
import axios from 'axios';
import Navbar from '../../navbar/Navbar';
const CharactersPage = () => {

    const [characters,setCharacters] = useState([]);

    useEffect(() =>{
        const fetchAllCharacters = async () =>{
        try {
            const res = await axios.get("https://dattebayo-api.onrender.com/characters");
            setCharacters(res.data.characters);
            console.log(res.data.characters);
        } catch (error) {
            console.error(error);
        }
        }
        fetchAllCharacters();
    },[])

  return (
    <div>
        <div><Navbar/></div>
        <h1>Characters</h1>
        <div className="charactersPageContainer">
            {characters.map(characterItem =>{
                <div className="characterItemBox" key={characterItem.id}>
                    <div className="characterImage"><img src={characterItem.images} alt="React Image" /></div>
                </div>
            })}
        </div>
    </div>
  )
}

export default CharactersPage
